Identificador de Licença, sendo um identificador globalmente único para uma licença ou contrato sob o qual os itens são gerados, submetidos para processamento e/ou pagos, que é construído pela concatenação:
 - um código de agência emissora ISO/IEC 15459;
 - um número de licença ou contrato que está de acordo com as especificações da agência emissora;
 e que:
 - compreende apenas caracteres alfabéticos maiúsculos e/ou numéricos;
 - é único (ou seja, é distinto de qualquer outro identificador compatível com ISO/IEC 15459) dentro do domínio da agência emissora;
 - não pode ser derivado de qualquer outro identificador compatível com ISO/IEC 15459, emitido sob a mesma agência emissora, pela simples adição de caracteres ao seu final, ou sua remoção.

Código de área de pesca da FAO conforme definido pelo Departamento de Pesca e Aquicultura da FAO (http://www.fao.org. Pesquisar por sub-site do Código de Área de Pesca).
Todos os caracteres do subconjunto definido pela Especificação Geral GS1 de ISO/IEC 646 são permitidos.
Exemplos:
18L37.1.3 Mar Mediterrâneo Ocidental, Sardenha;
18L47.B.1 Atlântico, Sudeste, Divisão SEAFO, ZEE da Namíbia;
18L67 Pacífico, Nordeste.

Código de Local '26L', sendo um código que identifica um local ou área geográfica, ou um grupo associado de tais locais ou áreas, que tem relevância para uma transação relacionada e que está de acordo com uma das estruturas definidas em (a) a (f) abaixo:
a) dois caracteres alfabéticos maiúsculos correspondendo ao código de país ISO 3166-1 de duas letras do país em que, ou consistindo em que, o(s) local(is) ou área(s) estão situados;
b) três caracteres alfabéticos maiúsculos correspondendo ao código IATA do aeroporto ou cidade em, perto de, ou consistindo em que, o(s) local(is) ou área(s) estão situados;
c) quatro ou mais caracteres dos quais os três primeiros correspondem a um código de país ISO 3166-1 seguido por um traço (-), com o restante sendo um código postal no país em questão;
d) quatro ou mais caracteres dos quais os três primeiros correspondem a um código de país ISO 3166-1 seguido por um ponto (.), com o restante sendo um código de subdivisão de país ISO 3166-2 no país em questão;
e) cinco caracteres alfabéticos maiúsculos correspondendo ao UN/LOCODE da área em, perto de, ou consistindo em que, o(s) local(is) ou área(s) estão situados;
f) a concatenação, sendo não menos que sete e não mais que 35 caracteres de comprimento, de:
- um código de agência emissora ISO/IEC 15459;
- um código de local, consistindo de caracteres retirados do conjunto {A-Z; 0-9} que está de acordo com as especificações da agência emissora em questão.

