Método de produção para peixe e frutos do mar conforme especificado pelo Departamento de Pesca e Aquicultura da Organização das Nações Unidas para Alimentação e Agricultura (FAO), de acordo com o Regulamento da UE 1379/2013. (www.fao.org).
