Identificador de Equipamento, sendo um identificador globalmente único para um dispositivo, um item de equipamento ou instância de uma aplicação de computador usada na produção, transporte, processamento ou outro manuseio de itens, que é construído pela concatenação:
 - um código de agência emissora ISO/IEC 15459;
 - um número de equipamento que está de acordo com as especificações da agência emissora;
 e que:
 - compreende apenas caracteres alfabéticos maiúsculos e/ou numéricos;
 - é único (ou seja, é distinto de qualquer outro identificador compatível com ISO/IEC 15459) dentro do domínio da agência emissora;
 - não pode ser derivado de qualquer outro identificador compatível com ISO/IEC 15459, emitido sob a mesma agência emissora, pela simples adição de caracteres ao seu final, ou sua remoção.
ID do Leitor.
Identificador de equipamento, sendo um identificador globalmente único para um dispositivo, um item de equipamento ou instância de uma aplicação de computador usada na produção, transporte, processamento ou outro manuseio de itens.

Código de Localização da UPU, sendo um código identificando uma localização ou área geográfica, ou um grupo associado de tais localizações ou áreas, que tem relevância para uma transação relacionada e que está em conformidade com uma das estruturas definidas em a) até g) abaixo:
a) dois caracteres alfabéticos maiúsculos correspondentes ao código de país alfa-2 da ISO 3166-1 do país em que, ou consistindo de, a(s) localização(ões) ou área(s) estão situadas;
b) três caracteres alfabéticos maiúsculos correspondentes ao código IATA do aeroporto ou cidade em, perto de, ou consistindo de, a(s) localização(ões) ou área(s) estão situadas;
c) quatro ou mais caracteres dos quais os três primeiros correspondem a um código de país da ISO 3166-1 seguido por um traço (-), com o restante sendo um código postal no país em questão;
d) quatro ou mais caracteres dos quais os três primeiros correspondem a um código de país da ISO 3166-1 seguido por um ponto (.), com o restante sendo um código de subdivisão de país da ISO 3166-2 no país em questão;
e) cinco caracteres alfabéticos maiúsculos correspondentes ao UN/LOCODE da área em, perto de, ou consistindo de, a(s) localização(ões) ou área(s) estão situadas;
f) seis caracteres alfanuméricos maiúsculos correspondentes a um código IMPC da UPU alocado de acordo com o padrão S34 da UPU;
g) a concatenação, sendo não menos que sete nem mais que 25 caracteres de comprimento, de:
 - um código do emissor alocado de acordo com os padrões S31 da UPU;
 - um código de localização, consistindo de caracteres retirados do conjunto {A-Z; 0-9} que está de acordo com as especificações do emissor em questão.

Placa de Licença com Dados de Serviço e Código de Localização é uma construção de dados composta, conforme a especificação no padrão S25 da UPU, que inclui especificação de:
 - um identificador de item compatível com a ISO/IEC 15459;
 - uma especificação compatível com o identificador de dados 5U do serviço a ser fornecido em relação ao item;
 - um código de localização 17U da UPU compatível ou um código de localização 18U da UPU qualificado.
 Nota - Para mais detalhes, consulte o padrão S25 da UPU. A distinção entre um código de localização simples da UPU (DI 17U) e um código de localização qualificado da UPU (DI 18U) pode ser determinada a partir do primeiro caractere. Se este for numérico, aplica-se 18U; se for alfabético, aplica-se 17U.

Evento, Data e Hora.
Formato YYYYMMDDHHMM (relógio de 24 horas - UTC) seguido imediatamente por um Qualificador de Código UN/EDIFACT 2005 fornecendo um código especificando o tipo de data), por exemplo,
11 [Data quando as mercadorias são esperadas para ser despachadas/enviadas a mensagem é emitida.];
17 [Data/hora estimada de entrega quando se espera que as mercadorias sejam entregues];
35 [Data em que as mercadorias são entregues ao seu destino.];
118 [Reserva Confirmada];
129 [Data quando o navio/mercadoria partiu do último porto estrangeiro no país exportador.];
132 [Data/hora quando o transportador estima que um meio de transporte deve chegar ao porto de descarga ou local de destino.];
133 [Data/hora quando o transportador estima que um meio de transporte deve partir no local de partida];
137 [Data/hora quando o fornecedor envia peças com base no pedido do cliente. (Data quando a mensagem DESADV é emitida. Recomendação é que o DESADV seja emitido dentro de 30 minutos após as mercadorias serem recolhidas na parte ShipFrom];
146 [Data estimada de entrada (Alfândega) data em que a data oficial de uma Entrada Alfandegária é antecipada.];
151 [Data de Importação (Chegou ao porto com intenção de descarregar];
186 Parte de uma Instalação ('Saída do Portão)];
204 [Data em que a Alfândega libera mercadorias para o transportador ou importador];
253 [Parte de um Porto ('Partida do Navio')];
252 [Chega a um Porto ('Chegada do Navio')];
283 [Chega a uma Instalação ('Entrada no Portão)];
342 [Carga de Transporte];
351 [Inspeção do Portão do Terminal];
411 [Pedido de Enchimento];
412 [Pedido de Descarregamento];
420 [Descarga de Transporte];
534 [Reparado];
677 [Enchimento Confirmado];
678 [Descarregamento Confirmado];
696 [Data de Arquivamento].

Data, representada em forma modificada compatível com UTC:
yyyy[mm[dd[hh[mm[ss[fff]]]]]][poooo] onde colchetes indicam opcionalidade e yyyy é o ano, mmdd o mês e dia, hhmmss a hora do dia em horas minutos e segundos, fff as frações de segundos e poooo o deslocamento de UTC expresso em horas e minutos, o deslocamento sendo positivo se p for um ponto (.), negativo se P for um sinal de menos (-).
EXEMPLO:
2005 - (UTC) ano calendário 2005;
200505 - (UTC) mês calendário Maio 2005;
20050518 - (UTC) 18 de Maio de 2005;
200505181247 - 12:47 UTC em 18 de Maio de 2005;
200505181247.0100 - 12:47 horário local, sendo 11:47 UTC, em 18 de Maio de 2005;
20050518124723099 - 99 milissegundos após 12:47:23 UTC em 18 de Maio de 2005.

Data Qualificada, composta pela concatenação de:
- um código da agência emissora ISO/IEC 15459;
- um qualificador de data conforme as especificações dessa agência emissora;
- uma data cujo formato e interpretação estão de acordo com as especificações da agência emissora para esse qualificador de data.

Declaração da Categoria de Material de Embalagem*, Código* e Peso para um dado material de embalagem usado em uma dada embalagem de acordo com a diretiva da UE sobre embalagens e resíduos de embalagens. (Categoria de material e código definidos no Anexo M).
12ECCMMMMMMNNNNNUU onde: - '12E' (an3) é o Identificador de Dados;
 - 'CC' (n2) é a Categoria de Material conforme Anexo M;
 - 'MMMMMM' (an1...6) é o Código de Material conforme Anexo M;
 - 'NNNNN' (n5) Peso do Material, incluindo ponto decimal (por exemplo, 12.12);
 - 'UU' (an2) é a Unidade de medida para peso (por exemplo, KG, GR, LB ou OZ conforme ANSI X12.3 como em Anexo D).

Nome da Parte.
Nome de uma parte seguido por um caractere de mais (+) seguido por um ou mais valores de código da Lista de Códigos 3035 'Qualificador de Parte' da EDIFACT, por exemplo;
BY [Comprador];
CF [Operador de Contêiner];
CN [Consignatário];
CS [Consolidador];
DEI [Operador do navio/capitão do navio];
FA [Código de pessoal operacional];
IM [Importador];
MF [Fabricante];
OS [Expedidor];
SE [Vendedor];
ST [Enviar Para];
UC [Consignatário Final].

Número do Consignatário.
O número de identificação único pode ser o IRS, EIN, SSN, ou o número atribuído pela CBP, conforme necessário no Arquivo de Segurança. Apenas os seguintes formatos devem ser usados: IRS EIN: NN-NNNNNNN;
IRS EIN com sufixo:
NN-NNNNNNNXX;
SSN: NNN-NN-NNNN;
Número atribuído pela CBP: YYDDPP-NNNNN.
